import React from 'react';
import classes from './dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogsItem = (props) => {
    let path = "/dialogs/" + props.id; 
    return (
      <div className={classes.dialog}>
        <NavLink path={path}>{props.name}</NavLink>
      </div>
    );
}

const Message = (props) => {
    return (
        <div className={classes.message}>
            {props.message}
        </div>
    )
}

const Dialogs = (props) => {
    return (
      <div className={classes.wrapper}>
        <div className={classes.dialogsItems}>
          <DialogsItem id="1" name="Natalya" />
          <DialogsItem id="2" name="Rudick" />
          <DialogsItem id="3" name="Denis" />
          <DialogsItem id="4" name="David" />
          <DialogsItem id="5" name="Rojer" />
          <DialogsItem id="6" name="Max" />
        </div>
        <div className={classes.messages}>
          <Message message="Yo!" />
          <Message message="Hello my friend" />
          <Message message="How are you?" />
          <Message message="I am Ok" />
        </div>
      </div>
    );
}
export default Dialogs;
